import { css } from '@emotion/css';

export const styContainer = css`
  height: 70px;
  border-bottom-right-radius: 12px;
  border-bottom-left-radius: 12px;
  display: flex;
  align-items: center;
  padding: 0 20px;
  justify-content: space-around;
  border-top: 1px solid #808080;
`;
